import React from 'react';
import './App.css';
import Flower from './images/Vector 1.svg';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Harmony Link</h1>
        <p>Helping immigrant women to integrate into their new environment</p>
      </header>
      <main>
        <div className="flower-container">
          <img src={Flower} alt="Flower" className="flower" />
        </div>
        <div className="center-element">
          <input type="text" placeholder="Search..." />
        </div>
      </main>
    </div>
  );
}

export default App;
